func newSingletonPhysicsServer() *physicsServer {
	obj := &physicsServer{}
	name := C.CString("PhysicsServer")
	defer C.free(unsafe.Pointer(name))
	ptr := C.godot_global_get_singleton(name)
	obj.owner = (*C.godot_object)(ptr)
	return obj
}

