func newSingletonProjectSettings() *projectSettings {
	obj := &projectSettings{}
	name := C.CString("ProjectSettings")
	defer C.free(unsafe.Pointer(name))
	ptr := C.godot_global_get_singleton(name)
	obj.owner = (*C.godot_object)(ptr)
	return obj
}

